import React from 'react'
import VideoCard from '../home/home_right/videoCard/VideoCard'
export default function VideoWatchedRight() {
    const {loading, error, data} = useQuery(VIDEOS_WATCHED,{
        variables:{
            skip:"1",
            take: "5"
        }
    })
    if(loading) return <p>loading...</p>
    if(error) return `Error! ${error.message}`;
    console.log(data);
    return (
        <div className="col-xl-10 col-mb-10 col-sm-10">
        <div className="recommendedVideos">
            <div className="recommendedVideos_videos">
                <div>
                    <h2 style={{marginTop: '50px'}}>Danh sách video đã like</h2>
                        <div className="row">
                        <VideoCard/>
                        </div>
                </div>
            </div>
        </div>
    </div>
    )
}
